o, ali√°s, √© umponto de vista globalizante (sincr√¥nico) sobre a literatura, n√£o um \"ismo\" a mais. Outra coisa √© observar que a poesia concreta, pela sua radicalidade de propostas e problemas, sequer come√ßou a ser decodificada entre n√≥s, quanto mais assimilada... \" Des contemporains ne savent pas lire\" (Mallarm√©). Ouver.<br /><br />\nP: D√©cio Pignatari, numa entrevista, disse que previa, para os pr√≥ximos cinquenta anos, \"um certo cessar das transforma√ß√µes. E um longo per√≠odo de redund√¢ncias mais ou menos aceitas e que formar√£o a linguagem comum universal do fim do s√©culo...\" ‚Äì brincar de profeta √© um barato. Voc√™ topa?<br /><br />\nH. de Campos: O Lance de Dados de Mallarm√© ser√° talvez o manual de astron√°utica do ano 2.000. Astrol√≥gon ton H√≥meron ‚Äì Homero era astr√≥logo, dizia Her√°clito, o Obscuro (com uma ponta de ironia)...',NULL,NULL,NULL,NULL,NULL,''),(64,23,56,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(65,24,57,159,'159',NULL,NULL,NULL,NULL,NULL,''),(66,24,58,159,'159',NULL,NULL,NULL,NULL,NULL,''),(67,69,59,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(68,70,60,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(69,33,61,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(70,26,62,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(71,27,62,200,'200',NULL,NULL,NULL,NULL,NULL,''),(72,22,63,NULL,'P: Moacy Cirne escreveu, h√° algum tempo, que a diferen√ßa entre a poesia concreta e o poema¬≠processo estava no fato de a poesia concreta subordinar tudo √† estrutura, enquanto o poema¬≠processo subordinaria ao processo. Reconhecendo que esta distin√ß√£o √© claramente insustent√°vel, gostaria de saber qual a tua vis√£o do poema-processo.<br /><br />\nH. de Campos: O poema¬≠processo √© a doen√ßa infantil da poesia concreta.<br /><br />\nP: Voc√™ acabou de escrever um livro sobre o Macuna√≠ma de M√°rio de Andrade. A primeira op√ß√£o feita pelas novas gera√ß√µes diante da literatura brasileira √© entre M√°rio e Oswald de Andrade. Por Oswald se chega √† poesia concreta, √† guerrilha art