urgiram problemas, como o de determinada estrutura sonora precisar ser interpretada por um movimento. Bem, quando se aplicava o movimento, a parte sonora ca√≠a. Quando a parte sonora estava bem, ca√≠a o movimento. E a gente come√ßou a trabalhar em t√©cnica de movimento, t√©cnica vocal e se discutia o problema visual. Problemas de dan√ßa, m√∫sica, artes pl√°sticas ‚Äì artes integradas. O m√∫sico ficava sabendo porque determinada solu√ß√£o visual era esta e n√£o outra, etc. Em certo momento, comecei a conceber a organiza√ß√£o de \"Onirak\". Fui criando uma estrutura aberta, e propondo alguns pontos fixos nessa estrutura. A partir da discuss√£o, os pontos iam sendo introduzidos. A√≠ j√° pens√°vamos em apresentar o trabalho ao p√∫blico.<br />\n‚Äì N√≥s trabalhamos muito para dominar os materiais dessa estrutura. O espont√¢neo se d√° de duas formas. Ou √© o acaso, ou √© o resultado de um processo, uma disciplina. Eu escolhi o caminho da disciplina. Depois, comecei a elaborar a partitura, o desenho gr√°fico do que estava acontecendo. A partitura √© o reflexo de um est√°gio do trabalho. Com o desenvolvimento desse trabalho, muitos pontos se alteraram. Integramos mais elementos, como a parte de cinema, que √© uma esp√©cie de cen√°rio m√≥vel, din√¢mico, elaborado sobre a estrutura da pe√ßa, que funcionava como ponto de partida. A parte espacial depende das condi√ß√µes do local em que a gente for se apresentar.<br />\n‚Äì A gente queria que o p√∫blico participasse ativamente, e tudo foi planejado em fun√ß√£o dessa participa√ß√£o. A estrutura n√£o era linear, n√£o havia uma est√≥ria. Havia o personagem, mas ele era apenas um elemento, um est√≠mulo, para que as coisas acontecessem. O resultado foi satisfat√≥rio. Fizemos tr√™s apresenta√ß√µes em S√£o Paulo e aconteceu exatamente o previsto. No final de cada apresenta√ß√£o, a gente come√ßou a dar elementos ao p√∫blico, e foi passando do palco pra plat√©ia.¬†',NULL,NULL,NULL,NULL,NULL,''),(412,23,392,NULL,NULL,NULL,NULL,NULL,NULL,